        __Puts:put(t, key, value)\n    self[t] = self[t] or {}\n    table.insert(self[t],
        {k = key, v = value})\n    return self\n  end\n  -- create a frontend for
        __Puts that hides function entries\n  Puts = setmetatable({}, {__index = __Puts})\n\n  __Calls
        = {}\n  function __Calls:new(o)\n    o = o or {}\n    setmetatable(o, self)\n    self.__index
