        {func=_func, args=_args})\n    return self\n  end\n  Calls =  setmetatable({},
        {__index = __Calls})\n\n  function empty_list()\n    return setmetatable({},
        {__was_object=false})\n  end\n\n  function empty_object()\n    return setmetatable({},
        {__was_object=true})\n  end\n  ;pass=  tables, calls, votes, proposer_id =
        ...\n\n  -- interface definitions\n  PASSED = 1\n  PENDING = 0\n  REJECTED
